        with Article 13? - Burning Questions\",\n    \"description\": \"The latest
        on Article 13, and your top questions answered. \\n\\nThe text will go back
        to the European Parliament for a final vote as early as the 12th of March.
        Reach out to Members of Parliament to express your concerns: http://www.europarl.europa.eu/meps/en/home\\n\\nOur
        original Article 13 video: https://www.youtube.com/watch?v=TRYSxIYHS0w\\n\\nOn
        February 13th European lawmakers agreed on the final text of the EU Copyright
        Directive, which includes Article 13. The text will go back to the European
        Parliament for a final vote as early as the 12th of March.\\n\\nWe’ve had
        several  lawyers and policy experts examine the text.\\nThe good news is that
        the latest text has improved over the version written by the European Parliament
        last September. This is also thanks to all the YouTube creators who spoke
        up and made a big difference in having the creator point of view heard. \\n\\nAt
        the same time, while there have been improvements, we believe the final Article
        13 will still hurt, not help European creators.\\n\\nWhat’s the issue?\\nThe
        final text leaves a lot of ambiguity on what happens to content before YouTube
        receives notice from rightsholders. This will result in online platforms like
        YouTube blocking content because they need to remain on the side of caution
        and reduce their legal risks. \\n\\nSpecifically, the text is unclear on three
        things:\\n1) The role of rights holders in providing the necessary level of
        detail to identify their content.\\n2) It's unclear what kind of content platforms
